    false,nt"url": null,nt"notes": "From October 22 to November 22, 1985 the
    U.S. Geological Survey (USGS) conducted a single to survey to ensonify the Cayman
    Trough. The survey took place over the coastal region of the spreading ridge and
    along one line to the eastern extremity of the Trough. As in earlier EEZ reconnaissance
    surveys, the USGS utilized the GLORIA (Geological LOng-Range Inclined Asdic) sidescan-sonar
    system to complete the geologic mapping. The collected GLORIA data were processed
    and digitally mosaicked to produce continuous imagery of the sea-floor. Two digital
    mosaics of a 2 degree by 2 degree area with a 50-meter pixel resolution were completed
    for the Cayman Trough south of the Cayman Islands.",nt"license_title": null,nt"extras":
